#include <iostream>
#include <thread>
#include <queue>
#include <vector>
#include <chrono>
#include <atomic>

class Task {
public:
    Task(int id, const std::string& description) : id(id), description(description) {}
    
    void execute() {
        std::cout << "[Task " << id << "] Executing: " << description << std::endl;
        std::this_thread::sleep_for(std::chrono::milliseconds(100)); // simulace práce
    }

private:
    int id;
    std::string description;
};

class TaskQueue {
public:
    void addTask(const Task& task) {
        tasks.push(task);  // ❗ zde není synchronizace
    }

    bool getNextTask(Task& task) {
        if (!tasks.empty()) {
            task = tasks.front();
            tasks.pop();
            return true;
        }
        return false;
    }

private:
    std::queue<Task> tasks; // ❗ sdílený zdroj bez synchronizace
};

void producer(TaskQueue& queue, int startId, int count) {
    for (int i = 0; i < count; ++i) {
        Task t(startId + i, "Task from producer");
        queue.addTask(t);
        std::this_thread::sleep_for(std::chrono::milliseconds(50));
    }
}

void consumer(TaskQueue& queue, std::atomic<bool>& running) {
    while (running.load()) {
        Task t(0, "");
        if (queue.getNextTask(t)) {
            t.execute();
        } else {
            std::this_thread::sleep_for(std::chrono::milliseconds(10)); // čekání na úlohu
        }
    }
}

int main() {
    TaskQueue queue;
    std::atomic<bool> running(true);

    std::thread prod1(producer, std::ref(queue), 1, 20);
    std::thread prod2(producer, std::ref(queue), 100, 20);
    std::thread cons1(consumer, std::ref(queue), std::ref(running));
    std::thread cons2(consumer, std::ref(queue), std::ref(running));

    prod1.join();
    prod2.join();

    std::this_thread::sleep_for(std::chrono::seconds(3));
    running = false;

    cons1.join();
    cons2.join();

    std::cout << "Processing complete." << std::endl;
    return 0;
}

